        from tbl_client_dfiles_c2 where clientID = 3)

select * from tbl_c3_titles as c3t 
        where c3t.c3titleID not in (select <strong>DISTINCT</strong> c3tID
        from tbl_client_dfiles_c3 where clientID = 3)

